import React, { useState } from "react";
import string from "string"; // Ensure you have 'string' and 'random' imported

const PassWordEntry = () => {
  const [currentPassword, setCurrentPassword] = useState("");
  const [confirmNewPassword, setConfirmNewPassword] = useState(false);
  const [passwordStrength, setPasswordStrength] = useState("");

  const handlePasswordChange = (e) => {
    setCurrentPassword(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const confirmed = window.confirm(
      `Are you sure you want to create a new password based on "${currentPassword}"?`
    );

    if (confirmed) {
      setConfirmNewPassword(true);
    }
  };

  const handlePasswordLevelSelect = (level) => {
    const generatePassword = (currentPassword, level) => {
      const analyzePassword = (password) => {
        const hasUpper = /[A-Z]/.test(password);
        const hasLower = /[a-z]/.test(password);
        const hasSymbols = /[!@#$%^&*(),.?":{}|<>]/.test(password);
        const hasNumbers = /\d/.test(password);
        const length = password.length;
        return { length, hasUpper, hasLower, hasSymbols, hasNumbers };
      };

      const generateStrongPassword = (currentPassword) => {
        const { length, hasUpper, hasLower, hasSymbols, hasNumbers } =
          analyzePassword(currentPassword);
        let characterPool = "";
        if (hasLower) characterPool += string.ascii_lowercase;
        if (hasUpper) characterPool += string.ascii_uppercase;
        if (hasSymbols) characterPool += '!@#$%^&*(),.?":{}|<>';
        if (hasNumbers) characterPool += string.digits;

        let securePasswordList = [];

        for (let char of currentPassword) {
          if (char.match(/[a-z]/))
            securePasswordList.push(string.ascii_lowercase);
          else if (char.match(/[A-Z]/))
            securePasswordList.push(string.ascii_uppercase);
          else if (char.match(/\d/)) securePasswordList.push(string.digits);
          else if (char.match(/[!@#$%^&*(),.?":{}|<>]/))
            securePasswordList.push('!@#$%^&*(),.?":{}|<>');
          else securePasswordList.push(char);
        }

        while (securePasswordList.length < length) {
          securePasswordList.push(
            characterPool[Math.floor(Math.random() * characterPool.length)]
          );
        }

        return securePasswordList.join("");
      };

      const generateSimilarPassword = (currentPassword) => {
        let newPassword = "";
        for (let char of currentPassword) {
          if (char.match(/[a-z]/)) newPassword += char.toUpperCase();
          else if (char.match(/[A-Z]/)) newPassword += char.toLowerCase();
          else if (char.match(/\d/))
            newPassword += String(
              Number(char) < 5 ? Number(char) + 1 : Number(char) - 1
            );
          else newPassword += char;
        }
        return newPassword;
      };

      return level === "Strong"
        ? generateStrongPassword(currentPassword)
        : generateSimilarPassword(currentPassword);
    };

    const newGeneratedPassword = generatePassword(currentPassword, level);

    const confirmed = window.confirm(
      `You selected "${level}" level for password change. Proceed with new password: ${newGeneratedPassword}?`
    );

    if (confirmed) {
      console.log(
        `New password created with "${level}" strength:`,
        newGeneratedPassword
      );
      setCurrentPassword("");
      setConfirmNewPassword(false);
      setPasswordStrength("");
    }
  };

  return (
    <>
      <p>It's Time For Something New!</p>
      <div className="container">
        <div className="row justify-content-center">
          <form className="magic" onSubmit={handleSubmit}>
            <div className="form-group">
              <input
                type="password"
                className="form-control"
                placeholder="Enter Current Password"
                value={currentPassword}
                onChange={handlePasswordChange}
              />
            </div>
            <button
              type="submit"
              className="btn btn-primary"
              style={{ marginTop: "10px" }}
            >
              Submit
            </button>
          </form>
        </div>
      </div>

      {confirmNewPassword && (
        <div className="password-level-select">
          <h3>Select Password Change Level:</h3>
          <button
            className="btn btn-info"
            onClick={() => handlePasswordLevelSelect("Weak")}
            style={{ marginRight: "10px", marginTop: "10px" }}
          >
            Weak
          </button>
          <button
            className="btn btn-warning"
            onClick={() => handlePasswordLevelSelect("Medium")}
            style={{ marginRight: "10px", marginTop: "10px" }}
          >
            Medium
          </button>
          <button
            className="btn btn-danger"
            onClick={() => handlePasswordLevelSelect("Strong")}
            style={{ marginTop: "10px" }}
          >
            Strong
          </button>
        </div>
      )}
    </>
  );
};

export default PassWordEntry;
